import React from 'react';
import '../css/HeroSection.css'; // Assuming you create a CSS file for this component

const HeroSection = ({ headline, description, buttonText }) => {
  return (
    <section className="hero-section">
      <div className="hero-content">
        <h2 className='hor'>{headline}</h2>
        <p className='her'>{description}</p>
        <button className="cta-button">{buttonText}</button>
      </div>
      <div className="hero-image">
        <img
          className='fotito'
          src="https://i.blogs.es/8122e1/istock-1194430863/1366_2000.jpeg"
          alt="Hero"
          // Add any additional styles or attributes for the image
        />
      </div>
    </section>
  );
};

export default HeroSection;
